DROP TABLE IF EXISTS amazon_products;

CREATE TABLE amazon_products (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    asin TEXT,
    delivery TEXT,
    discount TEXT,
    image_url TEXT,
    original_price TEXT,
    price TEXT,
    prime TEXT,
    rating REAL,
    reviews_count INTEGER,
    sponsored TEXT,
    timestamp DATE,
    title TEXT,
    url TEXT,
    category TEXT,
    page TEXT
);

